import './App.css';
import React from 'react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="dropdown">
          <FontAwesomeIcon icon="fa-solid fa-plus-large" />
        </div>
      </header>
      <body className="App-header">
      </body>
    </div>
  );
}

export default App;
